#
# This file is the MIDI catalog. It contains calibration star list for MIDI.This
# list is provided by O. Chesneau from the following reference: R. van Boekel et
# al., 2005, "Photometric observations and angular size estimates of mid
# infrared interfeometric calibration sources".
# see JMMC-MEM-2600-0011 document.
#
# The table format is described in the table below:
# no column variable    description                                                     code UCD I
# ------------------------------------------------------------------------------------------------
# c1        HD          identificateur                                                  ID_MAIN
# c2        RAJ2000     coordonnée, ascension droite (h mn s)                           POS_EQ_RA_MAIN
# c3        DEJ2000     coordonnée, déclinaison (deg ' ")                               POS_EQ_DEC_MAIN <- POS_EQ_RE_MAIN
# c4        orig        origine de la mesure du flux IR (iras ou msx)                   IR_FLUX_ORIGIN <- NOTE
# c5        SpType      type spectral                                                   SPECT_TYPE_MK
# c6        Plx         parallaxe (mas)                                                 POS_PARLX_TRIG
# c7        e_Plx       erreur sur la parallaxe (mas)                                   POS_PARLX_TRIG_ERROR <- ERROR
# c8        pmRA        mouvement propre en ascension droite ("/an)                     POS_EQ_PMRA
# c9        pmDE        mouvement propre en déclinaison ("/an)                          POS_EQ_PMDEC <- POS_EQ_PMDE
# c10       Vmag        magnitude V (0,55mu)(mag)                                       PHOT_JHN_V
# c11       Hmag        magnitude H (1,65mu) (mag)                                      PHOT_JHN_H
# c12       F12         flux IR a 12mu mesure par IRAS (Jy)                             PHOT_FLUX_IR_12  <- PHOT_FLUX_IR_12
# c13       e_F12       qualité de la mesure de flux                                    PHOT_FLUX_IR_12_ERROR <- CODE_QUALITY
# c14       F12         flux IR a 12.13mu mesure par MSX (Jy)                           PHOT_FLUX_IR_12 <- PHOT_FLUX_IR_12
# c15       e_F12       Incertitude sur le flux à 1 sigma (%)                           PHOT_FLUX_IR_12_ERROR <- ERROR
# c16       Bin_HIP     binarité par Hipparcos <2" (donne: rho (") thêta (deg))         CODE_MULT_FLAG <- CODE_MULTI
# c17       Var         indice variabilité dans SIMBAD (valeurs: SB ou eclipsing B.)    CODE_VARIAB
# c18       Calib       étoile étalon spectro-photométrique (valeurs: c ou g)           REF_STAR <- NOTE
# c19       Teff        température effective du modèle (K)                             PHYS_TEMP_EFFEC <- PHYS_TEMP_EFFEC
# c20       e_Tef       erreur relative sur la température du modèle (%)                PHYS_TEMP_EFFEC_ERROR <- ERROR
# c21       Diam12 (mas)  diamètre calcule par le modèle (mas)                            DIAM12
# c22       e_Diam12      =erreur relative sur le diamètre (%)                            DIAM12_ERROR <- ERROR
# c23       A_V (mag)   absorption interstellaire dans le visible (mag)                 PHOT_EXTINCTION_TOTAL
# c24       Chi2        valeur du Chi2 pour l'ajustement du modèle                      CHI2_QUALITY <- CODE_QUALITY
# c25       SpTyp_Teff  température effective suivant le type spectral                  SP_TYP_PHYS_TEMP_EFFEC <- PHYS_TEMP_EFFEC
#*****************************************************************************/
